import zIndex from '@material-ui/core/styles/zIndex'
import {makeStyles} from '@material-ui/styles'

const useStyles = makeStyles((theme)=>({
   box:{  
      height:'120vh',
      width:'100%',
      zIndex:'1',
      overFLow:'hidden'
   },

   video:{
       width:"100%",
       height:'100%',
       objectFit:'cover',
    zIndex:'-1'
   },
   box1:{
      position:'absolute',
      zIndex:'3',
      maxWith:'1200px',
      alignItem:'center'

   }

}))

export default useStyles
